import './styles.scss'
import React from 'react';
import {withRouter} from 'next/router';
import {URL_ROOT} from '../../config'
import Link from 'next/link';

const ArticelV = (props)=>{
    const {articles} = props;
    return(
        <div className="box"> 
            {articles && articles.length > 0 ? articles.map((item,key)=>{
                var d = new Date();
                var months = ["January","February","March","April","May","June","July","August","September","October","November","December"];
                document.getElementById("demo").innerHTML = months[d.getMonth()] + ' '+ d.getFullYear();
                
                return(
                    <div  key={key} className="row">
                         <p><span></span></p>
                    </div>
                )
            }) : <p>not find products</p>}
        </div>
    )
}

export default ArticelV
